def solve(string1, string2):
    if len(string1) != len(string2):
        return False

    count1 = {}
    count2 = {}

    for char in string1:
        count1[char] = count1.get(char, 0) + 1

    for char in string2:
        count2[char] = count2.get(char, 0) + 1

    return count1 == count2

