def solve(str1, str2):
    if len(str1) != len(str2):
        return False
    else:
        count1 = {}
        count2 = {}
        for i in range(len(str1)):
            if str1[i] in count1:
                count1[str1[i]] += 1
            else:
                count1[str1[i]] = 1
            if str2[i] in count2:
                count2[str2[i]] += 1
            else:
                count2[str2[i]] = 1
        if count1 == count2:
            return True
        else:
            return False

